'jdash/ui/OverlayMixin':function(){
define(['dojo/_base/declare',
			'dojo/_base/lang',
			'./_WidgetBase',
			'dojo/on',
			'dojo/dom-construct',
			'dojo/query',
			'dojo/dom-class',
			'dojo/dom-style',
            'dojo/_base/Deferred',
            'dojo/_base/array',
            'dojo/json',
            'require',
            "dojo/dom-geometry",
            "dojo/has",
            "./Viewport",
            "klt/core/messageBus"
],
	function (declare, lang, _WidgetBase, on, domConstruct, query, domClass, domStyle, Deferred, array, Json,
              require, domGeom, has, Viewport, bus) {
	    return declare('jdash.ui.OverlayMixin', null, {

	        overlayNode: null,

            overlayClass: "d-mask",

	        destroyRecorsive: function () {
	            this.hideOverlay();
	            this.inherited(arguments);
	        },

	        hideOverlay: function () {
	            if (this.overlayNode) {
	                //document.body.removeChild(this.overlayNode);
	                domConstruct.destroy(this.overlayNode);
	            }
	            this.overlayNode = null;
	            if (this.resizeHandler)
	                this.resizeHandler.remove();
	        },

	        overlayVisible: function () {
	            return this.overlayNode != null;
	        },

	        resizeOverlay: function (node) {
	            if (!this.overlayVisible())
	                return;
	            var computedStyle = domStyle.getComputedStyle(node);
	            var output = domGeom.getMarginBox(node, computedStyle);
	            domGeom.setMarginBox(this.overlayNode, output);
	        },

	        setOverlayDefer: function (defer) {
	            this.showOverlay();
	            var self = this;
	            defer.then(function () {
	                self.hideOverlay();
	            }, function () {
	                self.hideOverlay();
	            });
	        },

	        showOverlay: function (node) {

	            if (this.overlayVisible())
	                return;

	            var node = node || this.domNode;

	            this.overlayNode = domConstruct.create("div");
	            domClass.add(this.overlayNode, this.overlayClass);
	            this.resizeOverlay(node);
	            domConstruct.place(this.overlayNode, node, 0);
	            var self = this;
	            if (!this.resizeHandler) {
	                this.resizeHandler = bus.subscribe("klt/viewport/resized", function () {
	                    self.resizeOverlay(node);
	                });
	            }
	        }
	    });
	});
},
'jdash/ui/DashboardTitle':function(){
define(["./_WidgetBase", "dojo/_base/declare"], function(widgetbase, declare) {
    return declare("jdash.ui.DashboardTitle", [widgetbase], {
        buildRendering: function () {
            this.inherited(arguments);
            this.initialContent && (this.domNode.innerHTML = this.initialContent);
            
        },

        postCreate: function () {
            var self = this;
            this.subscribe("jdash/dashboard/loading/completed", function(event) {
                if (event.sender.id == self.dashboardView)
                    self.domNode.innerHTML = event.args.model.title;
            })

            this.subscribe("jdash/dashboard/unloaded", function (event) {
                if (event.sender.id == self.dashboardView)
                    if (self.initialContent)
                        self.domNode.innerHTML = self.initialContent;
                    else self.domNode.innerHTML = "";
            })

            this.inherited(arguments);
        }
    });
} )
},
'jdash/ui/linker':function(){
define(["dojo/dom-construct",
     "dojo/_base/lang",
     "dojo/dom-attr",
     "dojo/query",
     "dojo/on",
     "dojo/json",
     "dojo/_base/array",
    "dojo/_base/window"], function (domConstruct, lang, domAttr, query, on, json, array, win) {
        var linker = {

            createControl: function (clazz, params, node, options) {
                for (var k in params) {
                    paramValue = params[k];
                    if (options.paramsReplace) {
                        var foundVal = options.paramsReplace[k];
                        if (typeof (foundVal) != "undefined")
                            paramValue = params[k] = foundVal;
                    }
                }
                var widget = new clazz(params, node);
                return widget;
            },

            link: function (node, options) {
                node = node || win.body();
                options = options || {};
                var jnodes = query('[data-jdash-type]', node);
                var self = this;
                var controls = [];

                jnodes.forEach(function (node) {
                    var clazzName = domAttr.get(node, "data-jdash-type");
                    var clazz = lang.getObject(clazzName);
                    if (clazz) {
                        var params = json.parse(domAttr.get(node, "data-jdash-params"));

                        try {
                            var ctrl = linker.createControl(clazz, params, node, options);
                            controls.push(ctrl);
                        } catch (e) {
                            console.log("error creating " + clazzName + " " + e);
                        }
                        
                        domAttr.remove(node, "data-jdash-type");
                        domAttr.remove(node, "data-jdash-params");
                    } else console.log(clazzName + " does not seem valid");
                });

                array.forEach(controls, function (control) {
                    if (lang.isFunction(control.startup))
                        try {
                            control.startup();
                        } catch (e) {
                            console.log("error starting control " + e);
                        }
                }, this);
                return controls;

            }
        }
        lang.setObject("jdash.ui.linker", linker);
        return linker;
    })
},
